COPY mr_remindermessage (id, week_number, day_number, reminder_text) FROM stdin;
155	1	1	Congratulations on your pregnancy! Have you gone to the clinic? You should be checked at least 4 times at a health centre to ensure a healthy pregnancy/baby.
156	1	3	Have you told someone you trust about your pregnancy? Tell your partner, a friend or family member early on so that they can support you.
157	1	5	Do you know your HIV status? Mothers can prevent their babies from being infected with HIV by taking action. Visit a health centre with your partner for testing
158	2	1	Do you sleep under a mosquito net at night to stop malaria? Malaria harms a mothers and babies. It causes babies to be born small or born dead. Get a net!
159	2	3	Stay healthy! Drink a lot of boiled water, juice and milk. Eat healthy four times a day: fruit, vegetables, beans or g-nuts. Eggs, meat or fish two times a week
160	2	5	Have you gone for your first health visit? Every pregnant woman should go to the health centre for at least 4 visits. Go as soon as you know you are pregnant.
161	3	1	Do you know where you will have your baby? What will you do if there is a problem during pregnancy? Speak with your family or health worker now, to make a plan.
162	3	4	Go to a health centre NOW if you have vaginal bleeding, fever, bad headache or blurred vision, swelling of face or body, convulsions or bad pain in lower  belly
163	4	1	Do you know that the move of HIV from mother to child can be stopped? If you have HIV remember to take your medicine to prevent your baby from getting infected.
164	4	3	You can prevent malaria by closing your windows and doors before dark and sleeping under a net every night. Visit a health worker if you need a mosquito net!
165	4	5	Make a pregnancy plan: Where to go for treatment? How to get there? Is there money set aside? Who will help at home if you are away? Talk to family and friends.
166	5	1	Know danger signs like vaginal bleeding, severe belly pain, fever, headache, blurred vision or swelling. Go to the health centre NOW if you have these problems.
167	5	3	Women should give birth in a health clinic with a doctor, nurse or midwife. Where will you give birth? Talk to a health worker, family or friends. Make a plan
168	6	1	Have you and your partner been tested? Go to a health centre for HIV testing and talk to a health worker about preventing infection of your baby.
169	6	3	Have you visited a clinic? Visit the health centre to check for anaemia, sphyilis, HIV and TB, and to get medicine to build your blood, for malaria and tetanus.
170	6	5	Stay healthy! Preganant women should not use alcohol, drugs, tobacco or herbal medicines because these can harm your baby.
171	7	1	Keep your body clean by bathing regularly. Brush your teeth every day.  Always wash your hands after using the latrine, before eating and before preparing food.
172	7	3	How will you get to a health clinic when you go into labour? Is there enough money to go there? Make a plan and discuss with your partner, friends and family.
173	7	5	You should always use a condom during sex. If you don't have HIV, condoms can protect you and your baby. Talk about it with your health worker and your partner.
174	8	1	Do you know your HIV status? An infected woman can protect her baby by taking action. Visit a clinic with your partner for tests and help keep your baby safe!
175	8	4	If you have fever, headache, joint paints, poor appetite, nausea, vomiting, diarrhoea, chest pain or look pale, go to a health centre now for help with malaria.
178	10	1	If you have vaginal discharge, sores on your private parts, or pain in lower belly go to a health clinic NOW to get help for the health of you and your baby!
179	10	3	At the health clinic a health worker will check your blood pressure and feel your belly. They will tell you around what date your baby should be born.
180	11	1	Eat 4 meals a day and bites between meals. Eat a variety of foods like bread, rice, fruit, vegetables, meat. Do not get thirsty, drink boiled water and juice.
181	11	4	Who will go with you to the clinic when you go into labour? Choose someone you trust and who can make decisions for you if needed. Make a plan with this person.
182	12	1	Are you taking iron and folate tablets? They are important for a healthy baby and to maintain a mother's blood level.  Make sure you take them every day!
183	12	4	What date is your baby due? Start planning with your partner, family and health worker so that you are prepared when the time comes.
184	13	1	Congratulations on your pregnancy! Have you gone for your first health visit? Go for your first visit as soon as possible for the health of you and your baby!
176	9	1	Drink safe and boiled water! Do not drink water directly from lakes, ponds and rivers. Do not eat soil or clay. This can make you and your baby sick.
177	9	3	Pregnancy is a wonderful time but you may also have worries.Talk about your pregnancy with your partner, friends and family members so they can support you.
